  var out = "";
  var params = data.split("&");
  for(var i = 0;i < params.length;i++) {
    var param = params[i];
    var keyValue = param.split("=");
    if(keyValue.length > 1) {
      var key = keyValue[0];
      var value = keyValue[1];
      var keyParts = key.split("_");
      if(keyParts.length >= 2 && keyParts[1] == "type") {
        out += key + "=" + value + "&"
      }else {
        out += key + "=" + "redacted" + "&"
      }
    }
  }
  return out
